import React from 'react';
import { Navbar, Container, FormControl, Button, Nav, NavDropdown, Form } from 'react-bootstrap';
import DarkLogo from '../images/DarkLogo.png';
import LightLogo from '../images/LightLogo.png';

export default function NavBarComponent() {
    return (
        <Navbar bg="dark" expand="lg">
            <Container fluid>
                <Navbar.Brand href="#"><img src={DarkLogo} alt="Logo" width="200" /></Navbar.Brand>
                <Navbar.Toggle aria-controls="navbarScroll" />
                <Navbar.Collapse id="navbarScroll">
                    <Nav
                        className="me-auto my-2 my-lg-0"
                    >
                    </Nav>
                    <Button style={{ fontWeight: 'bold' }} className="mx-2" variant="primary">REGISTER</Button>
                    <Button style={{ fontWeight: 'bold' }} className="mx-2" variant="danger">LOGIN</Button>
                    <Button style={{ fontWeight: 'bold' }} className="mx-2" variant="outline-secondary">REGISTER</Button>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    )
}
